"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[859],{4668:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"APP Empleo","metadata":{"permalink":"/blog-damiandevweb/blog/APP Empleo","source":"@site/blog/2024-07-28-appempleo.md","title":"Aplicacion de Empleo AMdelCo","description":"Nos complace anunciar que muy pronto lanzaremos nuestra nueva aplicaci\xf3n de empleo en AMdelCo, dise\xf1ada para revolucionar la forma en que las personas buscan y encuentran trabajo. Nuestra misi\xf3n es conectar a candidatos calificados con las mejores oportunidades laborales en el mercado.","date":"2024-07-28T00:00:00.000Z","tags":[],"readingTime":1.31,"hasTruncateMarker":true,"authors":[{"name":"Damian_Dev_Web","title":"Docente","url":"https://github.com/DamianTrajster","imageURL":"/blog-damiandevweb/img/logo-blog.png","key":"damian"}],"frontMatter":{"slug":"APP Empleo","title":"Aplicacion de Empleo AMdelCo","authors":"damian"},"unlisted":false,"nextItem":{"title":"Softa!","permalink":"/blog-damiandevweb/blog/Softa!"}},"content":"Nos complace anunciar que muy pronto lanzaremos nuestra nueva **aplicaci\xf3n de empleo** en AMdelCo, dise\xf1ada para revolucionar la forma en que las personas buscan y encuentran trabajo. Nuestra misi\xf3n es conectar a candidatos calificados con las mejores oportunidades laborales en el mercado.\\n\\n\\n\\n\\n\x3c!--truncate--\x3e\\n\\n## \xbfQu\xe9 Ofrece Nuestra Aplicaci\xf3n?\\n\\nLa aplicaci\xf3n de empleo de AMdelCo est\xe1 dise\xf1ada para ser intuitiva y f\xe1cil de usar, ofreciendo una experiencia fluida tanto para candidatos como para empleadores. Aqu\xed te presentamos algunas de sus caracter\xedsticas destacadas:\\n\\n![Bitumbo](/img/blog1.jpeg)\\n\\n\\n### 1. B\xfasqueda Personalizada de Empleos\\nLos usuarios pueden filtrar empleos por industria, ubicaci\xf3n, salario y otros criterios importantes. Esto permite a los solicitantes de empleo encontrar r\xe1pidamente oportunidades que se alineen con sus habilidades y preferencias.\\n\\n### 2. Perfiles de Usuario\\nCrea un perfil profesional completo con tu experiencia laboral, habilidades, educaci\xf3n y m\xe1s. Los empleadores pueden ver estos perfiles, lo que facilita la identificaci\xf3n de candidatos adecuados para sus necesidades.\\n\\n\\n### 3. Consejos y Recursos Profesionales\\nAccede a una variedad de art\xedculos, consejos y gu\xedas para mejorar tu curr\xedculum, prepararte para entrevistas y desarrollar tus habilidades profesionales.\\n\\n## \xbfC\xf3mo Empezar?\\n\\nMantente atento a nuestro lanzamiento oficial en los proximos meses.\\n\\n## Un Futuro de Oportunidades\\n\\nEn AMdelCo, creemos en el poder de la tecnolog\xeda para transformar el mercado laboral y ayudar a las personas a alcanzar su m\xe1ximo potencial. Estamos emocionados de ofrecer esta herramienta que facilitar\xe1 el proceso de b\xfasqueda de empleo y crear\xe1 nuevas oportunidades para todos.\\n\\n\xa1Gracias por ser parte de nuestra comunidad, y esperamos que encuentres el empleo perfecto con nuestra nueva aplicaci\xf3n!\\n\\n---"},{"id":"Softa!","metadata":{"permalink":"/blog-damiandevweb/blog/Softa!","source":"@site/blog/2024-07-26-softa.md","title":"Softa!","description":"SOFTA!: Impulsando el Futuro de los Nuevos Profesionales en Desarrollo Web...","date":"2024-07-26T00:00:00.000Z","tags":[],"readingTime":1.965,"hasTruncateMarker":true,"authors":[{"name":"Damian_Dev_Web","title":"Docente","url":"https://github.com/DamianTrajster","imageURL":"/blog-damiandevweb/img/logo-blog.png","key":"damian"}],"frontMatter":{"slug":"Softa!","title":"Softa!","authors":"damian"},"unlisted":false,"prevItem":{"title":"Aplicacion de Empleo AMdelCo","permalink":"/blog-damiandevweb/blog/APP Empleo"}},"content":"SOFTA!: Impulsando el Futuro de los Nuevos Profesionales en Desarrollo Web...\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n\\r\\n\\r\\n:::danger[Importante]\\r\\n    La Siguiente entrada de blog no esta vinculada con ninguno de los centros donde trabajo,CFP 20 y CFP 19, es un proyecto personal.\\r\\n\\r\\n    Las actividad seran remuneradas, pero no se garantiza un sueldo fijo, ya que dependera de los proyectos que haya en el momento.\\r\\n:::\\r\\n\\r\\n\\r\\n# SOFTA: Impulsando el Futuro de los Nuevos Profesionales en Desarrollo Web\\r\\n\\r\\nEn **SOFTA**, creemos que la mejor manera de aprender es haciendo. Nuestra empresa est\xe1 dedicada a proporcionar a los estudiantes una plataforma para desarrollar sus habilidades en la creaci\xf3n de p\xe1ginas y aplicaciones web, permiti\xe9ndoles obtener su primera experiencia laboral en un entorno de apoyo y crecimiento.\\r\\n\\r\\n## \xbfQu\xe9 Ofrecemos?\\r\\n\\r\\nSOFTA proporciona un entorno innovador donde los estudiantes pueden trabajar en proyectos reales y desarrollar soluciones digitales mientras adquieren experiencia valiosa. Aqu\xed te contamos m\xe1s sobre lo que hacemos:\\r\\n\\r\\n### 1. Proyectos Reales\\r\\n\\r\\nLos estudiantes tienen la oportunidad de trabajar en proyectos para clientes reales, lo que les permite aplicar sus conocimientos te\xf3ricos a situaciones pr\xe1cticas y obtener una comprensi\xf3n profunda del proceso de desarrollo web.\\r\\n\\r\\n\\r\\n\\r\\n### 2. Talleres y Recursos Educativos\\r\\n\\r\\nOfrecemos talleres regulares y acceso a recursos educativos para ayudar a los estudiantes a mejorar sus habilidades t\xe9cnicas y mantenerse actualizados con las \xfaltimas tendencias y tecnolog\xedas en el desarrollo web.\\r\\n\\r\\n### 3. Desarrollo de Habilidades Blandas\\r\\n\\r\\nAdem\xe1s de las habilidades t\xe9cnicas, fomentamos el desarrollo de habilidades blandas esenciales, como la comunicaci\xf3n, el trabajo en equipo y la gesti\xf3n del tiempo, que son cruciales para el \xe9xito en cualquier carrera profesional.\\r\\n\\r\\n## Beneficios para los Estudiantes\\r\\n\\r\\nParticipar en SOFTA ofrece a los estudiantes una ventaja competitiva al ingresar al mercado laboral. Obtienen:\\r\\n\\r\\n- **Experiencia Pr\xe1ctica:** Trabajar en proyectos reales mejora significativamente el portafolio y la empleabilidad de los estudiantes.\\r\\n- **Red de Contactos:** Interactuar con clientes y otros profesionales de la industria ayuda a construir una red profesional desde el inicio de su carrera.\\r\\n- **Confianza Profesional:** Al enfrentar y superar desaf\xedos del mundo real, los estudiantes desarrollan la confianza necesaria para enfrentar nuevos retos.\\r\\n\\r\\n## \xdanete a SOFTA\\r\\n\\r\\n**Actualmente esto es un proyecto en desarrollo , pronto tendremos mas novedades.**\\r\\n\\r\\n**Si tenes un proyecto en vista sea una pagina web o alguna aplicacion no dudes en consultar, contactame:  [BIO](https://lnk-bio-damian-dev-web.netlify.app/)**\\r\\n\\r\\n---\\r\\n\\r\\n*SOFTA: Donde la educaci\xf3n se encuentra con la innovaci\xf3n.*"}]}}')}}]);